import React from "react";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";

// Заглушки для игр
const TicTacToe = () => <h2>Крестики-нолики (в разработке)</h2>;
const RockPaperScissors = () => <h2>Камень, ножницы, бумага (в разработке)</h2>;
const MemoryGame = () => <h2>Игра на память (в разработке)</h2>;

const Home = () => (
  <div className="p-4 text-center">
    <h1 className="text-2xl font-bold mb-4">Мини-игровой хаб</h1>
    <nav>
      <ul className="space-y-2">
        <li><Link className="text-blue-500" to="/tic-tac-toe">Крестики-нолики</Link></li>
        <li><Link className="text-blue-500" to="/rock-paper-scissors">Камень, ножницы, бумага</Link></li>
        <li><Link className="text-blue-500" to="/memory-game">Игра на память</Link></li>
      </ul>
    </nav>
  </div>
);

const App = () => {
  return (
    <Router>
      <div className="min-h-screen flex flex-col items-center justify-center bg-gray-100">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/tic-tac-toe" element={<TicTacToe />} />
          <Route path="/rock-paper-scissors" element={<RockPaperScissors />} />
          <Route path="/memory-game" element={<MemoryGame />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
